up>1</msup><msup>4</msup></mfrac></math> kg of the biscuits. How much biscuits was left in the tin ?','ms','2023-05-20 00:00:00','','CHIJ 2012 CA1'),(24,'MA_P5','Which one of the following is the <strong> closed </stong> estimate of 12 786 Ã· 5 ?','ms','2023-05-20 00:00:00','','CHIJ 2012 CA1'),(25,'MA_P5','Find the sum of <math><mfrac><msup>5</msup><msup>8</msup></mfrac></math> and <math><mfrac><msup>1</msup><msup>6</msup></mfrac></math>. Leave your answer in its simplest form.','ms','2023-05-20 00:00:00','','CHIJ 2012 CA1'),(26,'MA_P5','Asheley bought a car and paid for it in instalments. Each instalments was $750. After paying 20 instalments, she still had to pay $3 465. Which one of the number sentences shows the actual cost of the car ? ','ms','2023-05-20 00:00:00','','CHIJ 2012 CA1'),(27,'MA_P5','The length of a rectangle is twice its breadth. Its perimeter is 306cm. Find its length.','ms','2023-05-20 00:00:00','G','CHIJ 2012 CA1'),(28,'MA_P5','Find the perimeter of the figure. (Note. All the lines meet at right angles.)','ms','2023-05-20 00:00:00','G','CHIJ 2012 CA1'),(29,'MA_P5','Which one of the following figures is sysmmetric figure?','ms','2023-05-20 00:00:00','G','CHIJ 2012 CA1'),(30,'MA_P5','Which one of the unit shapes below does not tessellate?','ms','2023-05-20 00:00:00','G','CHIJ 2012 CA1'),(31,'MA_P5','Round off 55 499 to the nearest 1000.','ms','2023-05-21 00:00:00','','ROSYTH 2012 CA1'),(32,'MA_P5','What is the value of 1 400 x 400 ?','ms','2023-05-21 00:00:00','','ROSYTH 2012 CA1'),(33,'MA_P5','Express 40 kg 36 g in kilograms.','ms','2023-05-21 00:00:00','','ROSYTH 2012 CA1'),(34,'MA_P5','Which of the following shapes can tessellated?','ms','2023-05-21 00:00:00','','ROSYTH 2012 CA1'),(35,'MA_P5','Bernice brought 150 sweets to her birthday party. She gave 5 sweets to each of her 5 friends and gave an equal number of sweets to each of her classmates. How many sweets had she left?','ms','2023-05-21 00:00:00','','ROSYTH 2012 CA1'),(36,'MA_P5','Some boys shared some marbles. If there were 6 boys , each boy would receive 42 marbles. What the difference in the number of marbles each boy would get if the marbles were shared equally among 9 boys ?','ms','2023-05-21 00:00:00','','ROSYTH 2012 CA1'),(37,'MA_P5','Jane jogged a distance of 4.12 km. She jogged 0.16 km further than Amanda. Min Yi jogged 0.26 km less than Amanda. How far did Min Yi jog ?','ms','2023-05-21 00:00:00','','ROSYTH 2012 CA1'),(46,'MA_P5','In 1 234 567, which digit is in the hundred thousands place?','ms','2023-05-23 00:00:00','','NANHUA 2012 CA1'),(47,'MA_P5','What is the value of the digial â€˜4â€™ in 543 613?','ms','2023-05-23 00:00:00','','NANHUA 2012 CA1'),(48,'MA_P5','What is nine million and nine in the numerals?','ms','2023-05-23 00:00:00','','NANHUA 2012 CA1'),(49,'MA_P5','Mr Tanâ€™s salary was $2500 when rounded off to the nearest hundred. What was the largest possible amount he could earn?','ms','2023-05-23 00:00:00','','NANHUA 2012 CA1'),(50,'MA_P5','Round off the sum of 10 450 and 540 to the nearest hundred','ms','2023-05-23 00:00:00','','NANHUA 2012 CA1'),(51,'MA_P5','Which of the following is <u>not</u>  divisble by 3?','ms','2023-05-23 00:00:00','','NANHUA 2012 CA1'),(52,'MA_P5','80 000 stickers are shared equally among 200 pupils. How many stickers does each pupil get?','ms','2023-05-23 00:00:00','','NANHUA 2012 CA1'),(53,'MA_P5','The product of 3 numbers is 210. <br> Which of the following is <u>not</u>  the possible set of numbers?','ms','2023-05-23 00:00:00','','NANHUA 2012 CA1'),(54,'MA_P5','How many eighths are there in 3<math><mfrac><msup>1</msup><msup>4</msup></mfrac></math> ?','ms','2023-05-23 00:00:00','','NANHUA 2012 CA1'),(55,'MA_P5','Which of the following is greater than <math><mfrac><msup>4</msup><msup>7</msup></mfrac></math>?','ms','2023-05-23 00:00:00','','NANHUA 2012 CA1'),(56,'MA_P5','What is the value of 1 â€“ 2 + 3 â€“ 4 + 5 &#8943;&#8943; 47 â€“ 48 + 49 ?','ms','2023-05-23 00:00:00','','NANHUA 2012 CA1'),(57,'